- input: '"TEXT","F3XN","C00165688","Please note that there are expenses disclosed
    on Schedule B for Line 21b for which this employee did not meet the definition
    of Federal Election Activity.  Salaries for all other employees were appropriately
    paid from a non-federal account.    The transfer(s) to our non-federal accounts
    were for cash flow purposes as noted on the report and were not used to finance
    activities in connection with federal elections or any other allocable administrative
    activity.    Payment of net proceeds from the ASDC Partnership Program - Affinity
    Card are made on an as-needed basis.  Please note that state party committees
    have been reporting memo entries on Schedule A for contributions received by joint
    fundraising programs during the reporting period in which the contribution was
    received irrespective of when or in what amount transfers are made.    Memo entries
    on Schedule A from Dollars for Democrats and from the State Party Democratic Victory
    Fund reflect the gross amounts raised, while the transfers to the North Carolina
    Democratic Party reflect the net amount.  Please note that state party committees
    have been reporting memo entries on Schedule A for contributions received by the
    joint fundraising program during the reporting period in which the contribution
    was received irrespective of whether transfers have been made."'
